INSERT INTO `product` VALUES (22, '160472574149878647', 7, 'AdGuard 广告拦截 隐私保护 软件', '<p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">地球村特高级的广告拦截程序！</strong><br style=\"box-sizing: border-box;\">AdGuard 是摆脱恼人广告，在线跟踪，保护您远离恶意软件的最佳方式。AdGuard 使您网络冲浪更快速，更安全，更安逸！</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">AdGuard for Windows</strong><br style=\"box-sizing: border-box;\">不只是广告拦截程序，它还组合了可获取最佳网络体验所需功能的多用途工具。其可拦截广告和危险网站，加速网页载入，保护儿童的在线安全。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">AdGuard for Mac</strong><br style=\"box-sizing: border-box;\">与其它广告浏览器不同，AdGuard 有专用于 macOS 的版本。其不仅可拦截 Safari 和其它浏览器内的广告，还可使您远离跟踪，钓鱼和诈骗。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">AdGuard for Android</strong><br style=\"box-sizing: border-box;\">安卓移动设备的理想解决方案。与其它广告拦截程序对比，AdGuard 无需根权限，其提供了丰富的功能：过滤应用，应用管理以及更多。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">AdGuard for iOS</strong><br style=\"box-sizing: border-box;\">用于 Safari 的最高级广告拦截器：其可拦截各种广告和计数器，加速页面载入，保护您的个人数据。有超过 50 个过滤器可用，您可按需调整过滤。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">广告拦截</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>AdGuard 会一次处理所有类型的烦人横幅广告，弹窗以及视频广告。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">隐私保护</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>AdGuard 隐藏您的数据，使其远离全集网络之上的跟踪器及活动性分析器。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">安全浏览</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>幸亏有了 AdGuard，您将能够避免所有诈骗和钓鱼网站及恶意攻击。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">家长控制</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'>通过限制儿童访问不适宜的和成人内容以保护他们的在线安全。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>为什么选择 AdGuard？</h5></blockquote><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">广告拦截</strong><br style=\"box-sizing: border-box;\">当今大多数广告拦截程序至少都能够确保广告拦截品质。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">页面装饰处理</strong><br style=\"box-sizing: border-box;\">许多 AdGuard 的同类产品也能够隐藏广告拦截后框架和空白空间。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">节省流量加速载入</strong><br style=\"box-sizing: border-box;\">与浏览器广告拦截程序不同，AdGuard 是在广告加载到浏览器之前就拦截了它们。这可节省流量加速载入页面。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">远离烦人的广告</strong><br style=\"box-sizing: border-box;\">AdGuard 提供专用的过滤器以拦截最烦人的元素（注册表单，在线顾问等）过滤任何浏览器或应用<br style=\"box-sizing: border-box;\">AdGuard 可完美协同所有和浏览器工作，包括 Windows 的 Metro 应用。</li></ul>', 0, 9, '2020-11-07 13:09:02', NULL, NULL, 0);
INSERT INTO `product` VALUES (23, '160862359597539007', 7, 'Acronis True Image 2020 专业数据备份恢复软件', '<blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>无与伦比的个人网络<br style=\"box-sizing: border-box;\">保护解决方案<br style=\"box-sizing: border-box;\">简单、高效、安全，拥有 100+ 增强功能。</h5></blockquote><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">不丢失任何数据</strong><br style=\"box-sizing: border-box;\">确保您始终有可信赖的数据副本，这样您就可以还原整个系统或单个文件。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">备份和恢复</strong><br style=\"box-sizing: border-box;\">镜像、磁盘克隆、一体式恢复驱动器，无论发生什么，都很容易确保数据可用于恢复。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">随地访问</strong><br style=\"box-sizing: border-box;\">无论您在哪里，在任何设备上从云备份中检索任何文件。远程管理备份。享受安全的文件同步和共享。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">创新保护</strong><br style=\"box-sizing: border-box;\">唯一一个使用人工智能实时阻止勒索软件和加密挖矿的个人备份解决方案。提供区块链数据公证。</li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>我们访问及使用数据的方式就像数据的威胁一样都在不断地变化。您的数据保护方式也需要随之发展。Acronis True Image 2020拥有100多个增强功能和新功能，让您始终与当下同步。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">自动双重保护</strong><br style=\"box-sizing: border-box;\">在本地备份，同时在云中复制它，这样您总是可以得到一个安全的非现场副本进行恢复。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">托盘通知中心</strong><br style=\"box-sizing: border-box;\">推送到桌面托盘的消息使您能够监视备份的状态，以便快速响应任何问题。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">自定义电源管理</strong><br style=\"box-sizing: border-box;\">通过高效管理笔记本电脑备份，避免耗尽电池电量。设置最低电源级别或阻止电池电源备份。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">选择Wi-Fi备份</strong><br style=\"box-sizing: border-box;\">备份的地方有您决定。现在，您可以轻松地避免按流量计费的连接和公共网络，这些连接和公共网络会危及数据。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">增强的云恢复</strong><br style=\"box-sizing: border-box;\">享受更快的性能和更直观的体验。增强功能可以更轻松的导航。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">最快的云备份</strong><br style=\"box-sizing: border-box;\">通过云备份和还原保护您的数据，独立机构证明其备份和还原速度比竞争对手快13倍。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">高效、一体化的保护</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>使用多种解决方案保护您的数据？然后您会花更多的钱来修补的您的防御漏洞。Acronis True Image 2020提供了集成的强大功能，具有数据保护、网络安全和管理功能，您可以通过一个直观的仪表盘控制这些功能</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">功能丰富</strong><br style=\"box-sizing: border-box;\">使用完整映像、文件/文件夹级备份、活动磁盘克隆、云到云 Office 365 备份、基于事件的排程、不间断备份和云中本地备份的自动复制等工具备份所需内容。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">可视化</strong><br style=\"box-sizing: border-box;\">一目了然地了解有关备份的所有内容。通过推送通知到桌面托盘监视备份的状态。借助可视化的仪表板查看文件大小、备份速度和存储数据类型的颜色条码。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">灵活</strong><br style=\"box-sizing: border-box;\">控制存储数据的位置，无论数据是本地存储在外部硬盘驱动器、网络文件夹或NAS设备上、云中的非现场存储，还是组合存储中都可确保完全保护。批准特定的Wi-Fi网络以避免潜在问题。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">兼容</strong><br style=\"box-sizing: border-box;\">无论数据位于何处，都能保护您的数据。支持最新版本的Windows、Mac、iOS和Android设备以及虚拟机。我们的集成反恶意软件防御是完全兼容其他反病毒软件。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">抵御最新的威胁</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>我们集成的人工智能防御系统可以实时检测和停止勒索软件，并自动恢复受影响的文件。去年，它成功击败了40多万次攻击。它还可以防止加密挖掘恶意软件窃取系统资源、降低性能和注入其他恶意软件。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>到 2020年，我们已经通过新的机器学习模型增强了它以阻止非法服务终止攻击，并提高了它的有效性。想知道为什么进程被标记为恶意的吗？现在您知道原因了。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>最佳可靠性</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>为什么我们的 Acronis True Image 如此简单、高效和安全？我们不断地测试、创新和支持我们的软件，这是任何竞争对手都无法比拟的。事实上，Acronis True Image 2020 具有100多个增强功能，旨在提供最佳的个人网络保护。</p>', 0, 9, '2020-12-22 15:53:16', NULL, NULL, 1);
INSERT INTO `product` VALUES (24, '160862376338184891', 7, 'AquaSnap 桌面窗口排列布局管理工具软件', '<blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">窗口边缘停靠</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>鼠标拖动窗口实现轻松分屏：拖放窗口到屏幕边缘或角落后，窗口将自动充满屏幕的一半或四分之一，此功能在 4K 显示器或者多个显示器上特别有用。这项特性与 Windows 10 内置的 Aero Snap 分屏功能类似，但 AquaSnap 却提供了更丰富的选择。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_Docking.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">窗口平铺</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>当两个窗口并排时，按住「Ctrl」键调整其中一个窗口，另一个窗口大小也会随之调整。这是一个容易操作，且非常有用的改变窗口布局的方法。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_GroupSize.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">窗口对齐</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>像素分毫，弥之珍贵，不要浪费您的每一寸桌面空间。经过精心设计的 AquaSnap 基础功能：为各个窗口添加 &ldquo;磁力&rdquo; 特性，使得对齐窗口变得更加轻松，确保您在使用过程中不会受到任何干扰。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_Snapping.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">窗口自动拉伸</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>双击窗口边缘，铺满您屏幕上的可用空间！这是另一种在桌面空间上，快速调整多个窗口的方式。双击窗口边缘，使其在一个方向上最大化。按住「Shift」同时双击窗口边缘，可使其垂直或水平最大化。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_Stretching.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">同时移动多个窗口</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>轻松管理悬浮小窗口。专业应用程序与复杂 UI 的小工具通常分散在桌面不同位置，想同时移动全部窗口？按住「Ctrl」时移动一个窗口，所有相邻的同组窗口即可随之移动。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_GroupMove.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">窗口置顶</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>需要一直盯着一个小窗口？晃动窗口，使其透明置顶。再次晃动以恢复其正常状态。如果想在一个全屏应用之上保持另一个窗口始终可见，那么这就是最佳方式。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2020/01/APSGO-aquasnap_AquaShake.gif\" alt=\"\" width=\"322\" height=\"242\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; text-align: center; height: auto;\" class=\"fr-fic fr-dib\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-styl