width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">为什么选择 Avast Business？</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>我们超过 4 亿名活跃用户提供持续的数据流，帮助我们快速识别和销毁任何威胁 &ndash; 并预测未来的威胁。在全球范围内，我们基于云的庞大机器学习引擎日以继夜地不断发展和学习，使我们的解决方案比以往更智能、更快速、更强大。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">更深入的检查<br style=\"box-sizing: border-box;\">我们的实时智能扫描程序会立即隔离具有不熟悉行为的可疑文件，并开始解析文件以执行更深入的分析。我们隔离可疑文件的能力使我们能够比市场上的任何解决方案更好地防止零日攻击。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">更快速的检测<br style=\"box-sizing: border-box;\">新恶意软件变种出现的速度惊人，因此快速检测至关重要。我们的技术可以在几秒钟内识别到一台设备上的恶意软件和零日攻击变体，并立即将更新部署到整个网络。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">更智能的数据<br style=\"box-sizing: border-box;\">我们的安全云每天检查超过 2000 亿个 URL 和 100 万个新的可执行文件。我们每个月都会阻止 35 亿次恶意软件攻击。每当有人下载文件时，我们都会从中学习，以便为新出现的威胁提供宝贵见解。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">适合您的终端保护解决方案<br style=\"box-sizing: border-box;\">我们专注于简单易用的用户友好型产品，保证拥有任何专业水平的用户都能得心应手地使用我们的产品。产品界面易于理解，并可根据您的需求和偏好进行设置。终端安全产品可以由任何人管理，而且随着业务的扩展，可以与您一起成长。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">系统要求</strong></h5></blockquote><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">Windows:</li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Avast Software s.r.o. 在以下版本的操作系统中为 Avast Business 产品提供支持：Windows 7 (Service Pack 1)、Windows 8、Windows 8.1、Windows 10 &ndash; Windows 10 Pro、Windows 10 Education 和 Windows 10 Enterprise。Avast Business 产品在 Windows 10 的以下服务分支上受支持 &ndash; 当前分支 (CB)、当前分支企业版 (CBB)、长期服务分支 (LTSB)，并将在应用程序的生命周期内提供支持。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">硬件:</li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Intel Pentium 4 / AMD Athlon 64 CPU，支持 SSE2 指令，256 MB+ RAM 和 2 GB 硬盘空间。</p>', 0, 9, '2020-12-22 16:00:10', NULL, NULL, 0);
