INSERT INTO `product` VALUES (28, '160862420964876913', 7, 'WOLFRAM Mathematica软件 -政府许可证', '<blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px; text-align: left;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">WOLFRAM MATHEMATICA</strong><br style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">地球村现代技术计算的终极系统</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Mathematica 在其三十年的开发历程中，在技术计算领域确立了最先进的技术，并为全球技术创新人员、教育工作者、学生和其他人士提供了最主要的计算环境。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Mathematica 以卓越的技术和简便的使用方法享誉全球，在此基础上，它提供了单个集成并且持续扩展的系统，涵盖了最广最深的技术计算功能，并可通过网页浏览器实现云端的完美访问，以及在所有现代桌面系统上的本地访问。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">现代技术计算的绝佳选择</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>通过三十多年来的精心研发和不断探索，Mathematica 在许多领域独树一帜，<br style=\"box-sizing: border-box;\">在当今技术计算环境和工作流程中表现卓著。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">一个全面集成的大型系统</strong><br style=\"box-sizing: border-box;\">Mathematica 具有涵盖所有技术计算领域的将近 6,000 个内置函数&mdash;&mdash;所有这些都经过精心制作，使其完美地整合在 Mathematica 系统中。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">不仅仅是数字，也不仅仅是数学，内容包罗万象</strong><br style=\"box-sizing: border-box;\">基于三十多年来的持续开发，Mathematica 在所有技术计算领域表现卓著，包括网络、图像、几何、数据科学、可视化、机器学习等等。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">不可想象的算法功能</strong><br style=\"box-sizing: border-box;\">Mathematica 在所有领域构建了前所未有的强大算法&mdash;许多算法都是使用 Wolfram 语言独特的开发方法和功能进行构建的</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">前所未有的高级</strong><br style=\"box-sizing: border-box;\">从超级函数到元算法，Mathematica 提供了可实现自动化并且日益完善的高级环境，使您的工作尽可能地高效。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">整体达到工业强度</strong><br style=\"box-sizing: border-box;\">拥有跨越各个领域的强大的高效的算法，Mathematica 是为提供工业强度而构建的，它的并行计算、GPU 计算等功能使其可以轻松处理大型问题。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">易于使用的强大功能</strong><br style=\"box-sizing: border-box;\">Mathematica 凭借它的算法功能以及 Wolfram 语言的详细设计原理，创建了具有预测性建议、自然语言输入等的独特的并且易于使用的系统。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">文档以及代码</strong><br style=\"box-sizing: border-box;\">Mathematica 使用 Wolfram 笔记本界面，使您可以快速整理包括文本、可运行代码、动态图形和用户界面等的丰富文档中的任何内容。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">代码可读性强</strong><br style=\"box-sizing: border-box;\">使用直观的类似英文的函数名称和一致明了的设计，Wolfram 语言易于阅读、编写和学习。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">得到最美观的结果</strong><br style=\"box-sizing: border-box;\">Mathematica 使用最先进的计算美学和设计原理，为你呈现最美观的结果；立即创建最顶级的互动可视化效果和出版物质量级别的文档。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">超过十五万个范例</strong><br style=\"box-sizing: border-box;\">从 参考资料中心 的 150,000 多个范例，Wolfram 演示项目的将近 10,000 个开源演示项目和其他资源中获取帮助，开始着手任何项目。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">即时现实数据</strong><br style=\"box-sizing: border-box;\">Mathematica 可以访问广博的 Wolfram 知识库，包括最实时的数千个领域的数据。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">完美的云端集成</strong><br style=\"box-sizing: border-box;\">Mathematica 目前已经完美地集成于云端系统中；可在统一强大的云端桌面混合环境中进行分享、云计算以及更多功能。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">与任意内容连接</strong><br style=\"box-sizing: border-box;\">Mathematica 为与任意内容连接而构建：文件格式（180 多种）、其他语言、 Wolfram Data Drop、API、数据库、程序、物联网和设备，甚至其自身分布等。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">覆盖范围</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Mathematica 基于具有突破性意义的 Wolfram 语言。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">符号式语言</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">数学计算</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">数值方法</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">可视化</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">代数操作</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">数论</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">数据分析</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">图形计算</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">交互式计算</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">图像计算</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">几何计算</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">导入和导出</li></ul>', 1, 9, '2020-12-22 16:03:30', '<p style=\"text-align: center;\"><span style=\"font-size: 18px;\">您的密钥是{goods}，请妥善保管！</span></p>', 1, 1);
