INSERT INTO `product` VALUES (35, '160862475288013262', 7, 'Radmin 3 远程控制软件', '<p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: center;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">Radmin 可轻松实现无人值守的远程计算机和服务器，无论你身处何方都可以快速访问远程 PC ，是每一位 IT 专业人士的必备工具。</strong></p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Radmin 是现今安全可靠的远程访问软件产品，全球超过 10 万家企业选择 Radmin 为员工提供远程技术支持。政府、军队、技术专家和金融组织依赖于其强大的能力。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>快捷远程操作，安全访问，远程速度快，支持30天全功能免费试用。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">局域网</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>若远程的电脑在同一网络下可通过局域网(LAN)联机，则可以使用IP地址或DNS名称与之相连。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">互联网</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>若远程的电脑在另外一个遥远的地方，只要电脑连接互联网，那么你就可以轻松的与之相连。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">操作快捷</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Radmin 拥有最高的操作速度，使用远程计算机如同使用本地计算机一样。其特殊的低带宽优化功能使之在使用 3G 网络时，也能顺畅远程操控计算机。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">安全访问</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Radmin 的安全能力完全内置。使用 Radmin 时，所有传输数据都通过高级加密标准 256 位(AES-256) 进行加密保护。在 Radmin 诞生的 17 年中，并未出现过漏洞。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">用户友好型</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Radmin 的安装和更新速度很快，相关说明清晰明了。对大型网络管理员而言，可以通过特殊免费实用程序，将预设的 Radmin 自动安装在用户 PC 机上。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">在世界任何一个角落远程控制你的PC</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>优化您的工作流程，并节省时间设置和管理设备之间的安全文件传输。清楚获取哪些文件正在传输到哪个设备的信息，并时刻监控您的PC。在局域网或因特网上维护无人值守的计算机和服务器，确保远程系统管理简单高效。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">内网与外网之间快速远程</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">提高技术支持的响应时间</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">全天候访问办公室计算机</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">节省技术人员的差旅费用</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">远程关闭计算机</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">PC 机和服务器故障排除</li></ul>', 0, 9, '2020-12-22 16:12:33', NULL, NULL, 1);
