工作站上为一个用户帐户远程集中管理 GoodSync 运行。-Windows 7/8/10，macOS 10.10+ 。每个用户每个工作站一年订阅。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">GoodSync Server Runner</strong></li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>一个许可证允许通过 GoodSync 云管理控制中心在一个物理或虚拟 Windows / Linux 服务器上为一个用户帐户远程集中管理 GoodSync 运行。-Windows / Linux Server 。每个用户每个服务器一年订阅。</p>', 1, 9, '2020-12-22 16:14:35', '<p>感谢购买GoodSync Business</p><p>下载链接{goods}</p>', 1, 1);
INSERT INTO `product` VALUES (38, '16086250212668296', 7, 'Wolfram|One 高等级,云端 + 桌面混合计算平台软件', '<p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: left;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">Wolfram|One 是首个云端ー桌面完整混合集成的计算平台ー利用 Wolfram 技术堆栈的全部功能的理想接入点。</strong></p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>从数据分析到建模（运用我们或您自己策管的数据），从发布 API 到实时演示最新研发的产品，从即时暂存器到快速编写原型，Wolfram|One 是处于世界领先地位的计算公司携30年的经验积累推出的简单便捷、立即可用的产品。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">如果是计算，我们便能实现！</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>从基本网页表单到大型数据分析，Wolfram 技术中涵盖了执行任何类型计算任务的功能。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><img data-fr-image-pasted=\"true\" src=\"https://apsgo.com/wp-content/uploads/2019/10/APSGO-wolfram-one_01.png\" alt=\"\" width=\"700\" height=\"318\" srcset=\"https://apsgo.com/wp-content/uploads/2019/10/APSGO-wolfram-one_01.png 700w, https://apsgo.com/wp-content/uploads/2019/10/APSGO-wolfram-one_01-300x136.png 300w, https://apsgo.com/wp-content/uploads/2019/10/APSGO-wolfram-one_01-370x168.png 370w, https://apsgo.com/wp-content/uploads/2019/10/APSGO-wolfram-one_01-600x273.png 600w\" sizes=\"(max-width: 700px) 100vw, 700px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto;\" class=\"fr-fic fr-dii\"></p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">Wolfram|One 经典范例</strong></h5></blockquote><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">运用 Wolfram 语言多样的绘图函数集和自定义样式选项，我们制作了一系列显示该社会网络内涵及本质的独特视图。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">Wolfram 技术包含了内置的金融数据、强大的算法和自动化的进程管理，这些不但帮助我们在创纪录的时间内构建和部署我们的交易预测软件，同时还提高了速度和结果的准确性。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">用不到20行的代码，我们创造出了可以生成地图和最优驾驶路线的表单界面，并可直接作为网页部署于云端。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">即使没有编程背景，我也能够运用Wolfram 语言内置的数据语义学、统计函数和可视化功能对芝加哥马拉松的数据进行深度探索。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">Wolfram 算法库的深度和广度，让我能够根据按语义导入的网页数据，轻松创建可以进行图形计算和机器学习的交互式电影推荐系统，这些都基于语义导入的网页数据。</li></ul>', 1, 9, '2020-12-22 16:17:01', '<p><span style=\'color: rgb(209, 0, 0); font-family: \"Microsoft YaHei\", \"Hiragino Sans GB\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important;\'>Wolfram|One 是世界首个云端ー桌面完整混合集成的计算平台ー利用 Wolfram 技术堆栈的全部功能的理想接入点。</span>&nbsp;</p><p>下载使用：{goods}</p>', 1, 1);
INSERT INTO `product` VALUES (39, '160862528316013046', 7, 'ATLAS.ti 9 Windows Mac 专业定性数据分析软件', '<blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">什么是 ATLAS.ti 9</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: border-box; font-weight: 700;\">ATLAS.ti 9</strong> 非常直观，比任何其他QDA 程序更容易学习和使用 &ndash; 包括旧版本的 ATLAS.ti。</span></p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">对于我们的最新产品，我们密切关注用户的需求和愿望，并特别关注最大程度的可用性。ATLAS.ti 9 完全改进的界面设计遵循功能导向的可用性的严格原则。它采用逻辑带状结构，上下文菜单和键盘快捷键，使您的工作流程尽可能符合人体工程学。</span></p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>已经消除了旧版本的缺点，并且添加了许多要求的新功能。最值得注意的是，现在可以对程序的各个方面进行无限制的撤销/重做。完全本机&nbsp;<strong style=\"box-sizing: border-box; font-weight: 700;\">Unicode</strong> 支持允许您使用任何语言和字符集中的材料。易于使用的搜索工具可在项目的每个级别执行细粒度搜索。同时使用多个数据源支持新的比较方法。</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">很容易学习。许多以前复杂的过程已经从根本上简化了。重点是快速有效地获得结果。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">强大而创新。时尚的网络可视化既可用于分析过程，也可提供出色的演示工具。从 Twitter和您最喜欢的参考经理导入调查，数据是轻而易举的。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">带有未来的内置功能。ATLAS.ti 9完全重写并基于最新技术，可实现快速，模块化扩展。因此 ATLAS.ti 9 在设计上继续增长，因此期望在未来几个月和几年内看到以前无法想象的新可能性。</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">特征</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>这些是 ATLAS.ti 9 Windows 的一些强大功能：</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">最先进，高度直观的用户界面，带有色带，标签视图</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">通过Navigator即时访问所有项目项目</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">区域允许同时处理多个文档，备忘录，网络等</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">强大的交互功能比以往更强大的&ldquo;边际&rdquo;。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">直接导入Twitter和Evernote数据</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">通过从Endnote等参考管理人员的导入支持文献审查</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">所有对象类型的多功能词云</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">所有对象类型的组</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">整个Unicode &ndash; 使用任何语言或字符集的文档</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">撤消/重做（100步）</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">强大的可视化查询编辑器</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">SmartCodes和SmartGroups</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">拆分代码</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">完整项目搜索（以前的&ldquo;Word cruncher&rdquo;）通过动态淡入/淡出命中类别得到显着改善</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">优雅且非常有用的新网络布局选项</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">所有项目的预览和评论</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">与ATLAS.ti Mac进行双向项目交换</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">板载编码器协议测量工具</li></ul><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">ATLAS.ti 的试用版是免费的，没有时间限制！</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>由于试用版与完整版完全相同（下面列出的限制除外），因此适用相同的技术要求。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>ATLAS.ti 的试用版没有到期日。除了以下限制外，再无其他限制：</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>虽然您可以打开并使用任何大小的项目，但无法保存超过特定大小的项目。最大允许大小为：</p><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">10个主要文件（无限大小）</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">100个 quotations (= data segments)</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">50个编码</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">30个备忘录</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">10个网络</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">自动备份功能无法使用。</li></ul><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>注意：试用版在崩溃后没有数据恢复 ！这意味着如果具有试用版的会话因任何原因而提前终止，则该点未保存的所有数据都将丢失。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>同样，完整版本具有自动恢复机制，因此您的数据始终是安全的。但试用版不适用于生产工作，因此您唯一的选择是如果您希望保留项目，请尽可能频繁地手动保存项目。</p>', 1, 9, '2020-12-22 16:21:23', '<p><span style=\"font-size: 18px;\">下载ATLAS.ti 9：{goods}</span></p>', 1, 1);
INSERT INTO `product` VALUES (40, '160862565632287858', 7, 'Virtual Serial Port Control 虚拟串行端口控制软件', '<p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>通过您自己的应用程序创建和控制虚拟 COM 端口。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'><strong style=\"box-sizing: border-box; font-weight: 700;\">概述</strong></h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>虚拟串行端口控制是一个功能强大的软件开发人员工具包 （SDK），它使得创建虚拟串行端口并完全控制它们成为可能。在创建串行设备仿真器时或必要时向现有旧式串行通信应用程序添加新逻辑时，它非常有用。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>虚拟串行端口通常出现在操作系统中的硬件 COM 端口中，因此串行通信应用程序与它们一起运行，就像它们是真正的硬件串行端口一样。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>另一方面，使用开发人员 API 的程序通过通信应用程序获取写入虚拟串行端口的所有数据。然后，应用程序可能会使用您自己的数据进行响应，通信应用程序将从虚拟串行端口读取这些数据，其方式与从物理端口读取的数据相同。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>SDK</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>虚拟串行端口 API 以以下形式显示：</p><ol style=\'box-sizing: border-box; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">动态链接库</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">Activex</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">.NET 组件</li></ol><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>SDK 附带完整的文档、源代码示例和组件，用于集成到第三方安装程序中。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>事件驱动的体系结构</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>事件驱动的体系结构是一个软快照。您不必定期检查端口，以便查找信号是否已更改或是否有新数据可用于从虚拟串行端口读取。只需在代码中定义所需的例程，该例程将由相应的事件自动触发，并将处理数据。</p><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>同时，虚拟串行端口控制会立即通知应用程序通信应用程序对串行端口执行的任何操作（端口打开/关闭、设置 DTR/RTS 握手、波特率设置、XON/XOFF 设置等）。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>完全控制串行端口</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>该 API 为开发人员提供了对虚拟串行端口的完全控制。API 与虚拟串行端口结合，可以与物理串行设备与实际串行端口一起执行尽可能多的操作。该解决方案与虚拟串行端口的通信方式与串行设备与物理串行端口通信的方式相同。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>客户怎么说</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>易用性且价格实惠，使得选择虚拟串行端口控制 OEM 极具吸引力。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>OEM 许可证</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>该解决方案以一次 OEM 许可证的形式提供。这意味着，一旦购买，它可以集成到自己的项目，并重新分配没有任何版税。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>甚至更多&hellip;</h5></blockquote><ul style=\'box-sizing: border-box; list-style-type: square; padding-left: 20px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin-bottom: 7px;\">虚拟串行端口的外观和工作就像真正的硬件端口。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">串行数据比特率（传输速度）仿真。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">可以创建无限数量的虚拟 COM 端口对。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">重叠的虚拟 COM 端口支持（虚拟串行端口可以具有与现有物理 COM 端口相同的名称）。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">功能强大、直观的界面，使串行端口通信变得简单。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">混合 32 和 64 位环境。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">与 PnP 和 WMI 技术兼容。</li><li style=\"box-sizing: border-box; margin-bottom: 7px;\">适用于任何虚拟机。</li></ul>', 0, 9, '2020-12-22 16:27:36', NULL, NULL, 1);
INSERT INTO `product` VALUES (41, '160862617073944704', 7, 'Serial Port Control 串行端口控制工具软件', '<p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>允许应用程序以最简单的方式控制串行端口。</p><blockquote style=\'box-sizing: border-box; border-left: 4px solid rgb(133, 195, 32); border-right-width: 0px; padding: 0px 10px; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-size: 10px; border-right-color: rgb(133, 195, 32); font-family: \"Work Sans\", Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><h5 style=\'box-sizing: border-box; font-weight: 700; font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif, Arial, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); font-size: 14px; letter-spacing: 0px;\'>概述</h5></blockquote><p style=\'box-sizing: border-box; margin-bottom: 1.7em; margin-top: 0px; color: rgb(102, 102, 102); font-family: \"Work Sans\", Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-al